// src/Form.js
import React, {useState} from 'react';

function Form() {
  const [person, setPerson] = useState(
     {
        name: "",
        job: "",
     }
  );

}

function handleChange(event) {
    const { name, value } = event.target;
    if (name === "job")
      setPerson(
         {name: person['name'], job: value}
      );
    else     
       setPerson(
         {name: value, job: person['job']}   
       );
}

export default Form;
